INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 36, 1, 0, "", 0, 91002, "", 100, 40000);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 37, 1, 1, "今日は記念日、お祝いですね！\n焼肉、お寿司、ピザ、ケーキ～☆\nあなたとパーティできるなんて、\n幸せです～♪", 107501, 91002, "ぺコリーヌ", 150, 40001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 38, 2, 1, "この記念日を迎えられたのは、\n主さまの器量の賜物\nさすがは主さまでございます\nえらい、えらい♪", 107601, 91002, "コッコロ", 150, 40001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 39, 3, 1, "あんたもけっこうやるじゃない！\nちょっとは…割と…け、けっこう\n見直しちゃったわ\n褒めてあげる♪", 107801, 91002, "キャル", 150, 40001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 40, 4, 1, "あなたと私にとって、\n今日は特別な日\nあなたの支えがあるから、\n私は頑張れるんです！", 107701, 91002, "スズメ", 150, 40001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 41, 5, 1, "今日はキミにとっての\n特別な記念日だにゃ\nキミの活躍にはいつも\n猫ながら感謝してるにゃ～♪", 107901, 91002, "タマキ", 150, 40001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 42, 6, 2, "う～かき氷食べ過ぎて、\n身体が冷えちゃいました…\nあなたの体温で温めてください！\nギューーッ♪", 107501, 91002, "ぺコリーヌ", 150, 40001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 43, 7, 2, "夏は危険がいっぱいと申します…\nですが、わたくしが主さまを\nしっかりとお守りいたしますよ", 107601, 91002, "コッコロ", 150, 40001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 44, 8, 2, "ん～なんであんたと、ひと夏を\n過ごすことになったのかな…\n結構楽しいからいいけど！\nさ、まだまだ遊ぶわよ！", 107801, 91002, "キャル", 150, 40001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 45, 9, 2, "あなたと過ごすはじめての夏…\nいまからドキドキが止まりません\n楽しくて素敵な思い出が、\nまた一つ増えるんですね♪", 107701, 91002, "スズメ", 150, 40001);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 8, 46, 10, 2, "夏は一番の稼ぎ時にゃのに、\n今年はキミと過ごしたいって\n思ってるにゃ楽しい思い出\n増やしてくれるかにゃ？", 107901, 91002, "タマキ", 150, 40001);
