INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 2, 321, 1, 1, "もうすぐ、みなさまに\nお会いできるのですね。\n胸が高鳴ってしまいます……\n", 125801, 24001, "リリ", 1, 40011);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 2, 322, 2, 1, "初めまして、クリアです♪\nみなさんと一緒に冒険するの\nとっても楽しみにしてます", 126001, 24001, "クリア", 1, 40011);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 2, 323, 3, 1, "んーと。\nこれ、あげる。\nはい", 126101, 24001, "プレシア", 1, 40011);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 2, 324, 4, 2, "あらためまして……\n【アルターメイデン】の\nギルドマスター、リリと申します", 125801, 24001, "リリ", 1, 40011);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 2, 325, 5, 2, "こんにちは、お兄さん♪\n【アルターメイデン】の\nクリアです", 126001, 24001, "クリア", 1, 40011);
INSERT INTO `v1_b51f61b1cdd06b685ea36e86c3f548689926413afa1cd476bd024271dd59202c` VALUES (0, 2, 326, 6, 2, "お兄。\nきてくれて、うれしい", 126101, 24001, "プレシア", 1, 40011);
